import 'package:flutter/material.dart';
import './Detail.dart';

class Food {
  final String title;
  final String description;
  final String urlImage;

  Food(
      {required this.title, required this.description, required this.urlImage});
}

final List<Food> foods = [
  Food(
    title: 'Milanesa',
    description: 'Carne empanada',
    urlImage:
        'data:image/jpeg;base64,',
  ),
  Food(
    title: 'Kipes',
    description: 'Comida turca',
    urlImage:
        'data:image/jpeg;base64,',
  ),
  Food(
    title: 'Brownie',
    description: 'Gran postre de chocolate',
    urlImage:
        'data:image/jpeg;base64,',
  ),
  Food(
    title: 'Pizza',
    description: 'Masa con salsa de tomate y queso',
    urlImage:
        'data:image/jpeg;base64,',
  ),
];

class HomeScreen extends StatelessWidget {
  static const String name = 'home';
  String nombreEitu;

  HomeScreen({super.key, this.nombreEitu = ''});
  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: Text('Comidas'),
      ),
      body: ListView.builder(
        itemCount: foods.length,
        itemBuilder: (context, index) {
          final food = foods[index];
          return Container(
            margin: EdgeInsets.symmetric(vertical: 8, horizontal: 16),
            child: Card(
              child: ListTile(
                contentPadding: EdgeInsets.all(8),
                leading: Image.network(
                  food.urlImage,
                  width:
                      100, // Puedes ajustar estos valores según sea necesario
                  height: 100,
                  fit: BoxFit.cover,
                ),
                title: Text(food.title),
                subtitle: Text(food.description),
                onTap: () {
                  Navigator.push(
                    context,
                    MaterialPageRoute(
                      builder: (context) => DetailScreen(food: food),
                    ),
                  );
                },
              ),
            ),
          );
        },
      ),
    );
  }
}
